import { useEffect } from "react";
import { ListGroup, ListGroupItem } from "reactstrap";


const Contact =()=>{
    useEffect(()=>{
        document.title="contact || with ps";
    },[])
    return(
        <>
        <h1>contact on me following social media plateform</h1>
         <ListGroup>
             <ListGroupItem tag='a' href="https://www.facebook.com/login.php">facebook</ListGroupItem>
             <ListGroupItem tag='a' href="www.google.com">google.com</ListGroupItem>
         </ListGroup>
        </>
    )
}
export default Contact;
